In the diagram, $D$ and $E$ are the midpoints of $\overline{AB}$ and $\overline{BC}$ respectively.  Determine the sum of the $x$ and $y$ coordinates of $F$, the point of intersection of $\overline{AE}$ and $\overline{CD}$. [asy]
size(180); defaultpen(linewidth(.7pt)+fontsize(10pt));
pair A, B, C, D, E, F;
A=(0,6);
B=(0,0);
C=(8,0);
D=(0,3);
E=(4,0);
F=(8/3,2);
draw(E--A--C--D);
draw((-1,0)--(10,0), EndArrow);
draw((0,-1)--(0,8), EndArrow);
label("$A(0,6)$", A, W);
label("$B(0,0)$", B, SW);
label("$C(8,0)$", C, S);
label("$D$", D, W);
label("$E$", E, S);
label("$F$", F, SW);
label("$x$", (10,0), dir(0));
label("$y$", (0,8), dir(90));
[/asy]

Squares of side length 1 are arranged to form the figure shown. What is the perimeter of the figure? [asy]

size(6cm);

path sqtop = (0, 0)--(0, 1)--(1, 1)--(1, 0);

path sqright = (0, 1)--(1, 1)--(1, 0)--(0, 0);

path horiz = (0, 0)--(1, 0); path vert = (0, 0)--(0, 1);

picture pic;

draw(pic, shift(-4, -2) * unitsquare);

draw(pic, shift(-4, -1) * sqtop);

draw(pic, shift(-3, -1) * sqright);

draw(pic, shift(-2, -1) * sqright);

draw(pic, shift(-2, 0) * sqtop);

draw(pic, (-1, 1)--(0, 1)); draw(pic, (-1, 0)--(0, 0));

add(reflect((0, 0), (0, 1)) * pic); add(pic);

draw((0, 0)--(0, 1));

[/asy]

The graph of the equation $y = \frac{x}{x^3 + Ax^2 + Bx + C}$, where $A,B,C$ are integers, is shown below. Find $A + B + C$. [asy]
import graph; size(8.14cm); real lsf=0.5; pen dps=linewidth(0.7)+fontsize(10); defaultpen(dps); pen ds=black; real xmin=-3.52,xmax=4.62,ymin=-3.66,ymax=3.94;

pen cqcqcq=rgb(0.75,0.75,0.75);

/*grid*/ pen gs=linewidth(0.7)+cqcqcq+linetype("2 2"); real gx=1,gy=1;
for(real i=ceil(xmin/gx)*gx;i<=floor(xmax/gx)*gx;i+=gx) draw((i,ymin)--(i,ymax),gs); for(real i=ceil(ymin/gy)*gy;i<=floor(ymax/gy)*gy;i+=gy) draw((xmin,i)--(xmax,i),gs);

Label laxis; laxis.p=fontsize(10);

xaxis("$x$",xmin,xmax,Ticks(laxis,Step=1.0,Size=2,NoZero),Arrows(6),above=true); yaxis("$y$",ymin,ymax,Ticks(laxis,Step=1.0,Size=2,NoZero),Arrows(6),above=true); real f1(real x){return x/((x-1)*(x-2)*(x+2));} draw(graph(f1,-3.51,-2.01),linewidth(1.2)); draw(graph(f1,-1.99,0.99),linewidth(1.2)); draw(graph(f1,1.01,1.99),linewidth(1.2)); draw(graph(f1,2.01,4.61),linewidth(1.2));

clip((xmin,ymin)--(xmin,ymax)--(xmax,ymax)--(xmax,ymin)--cycle);

[/asy]

There exists a constant $c,$ so that among all chords $\overline{AB}$ of the parabola $y = x^2$ passing through $C = (0,c),$
\[t = \frac{1}{AC} + \frac{1}{BC}\]is a fixed constant.  Find the constant $t.$

[asy]
unitsize(1 cm);

real parab (real x) {
  return(x^2);
}

pair A, B, C;

A = (1.7,parab(1.7));
B = (-1,parab(-1));
C = extension(A,B,(0,0),(0,1));

draw(graph(parab,-2,2));
draw(A--B);
draw((0,0)--(0,4));

dot("$A$", A, E);
dot("$B$", B, SW);
dot("$(0,c)$", C, NW);
[/asy]

What is the area of the parallelogram shown, in square feet?

[asy]
draw((0,0)--(15,0)--(19,3)--(4,3)--cycle,linewidth(1));
draw((15,0)--(15,3),dashed);
draw((15,2.5)--(15.5,2.5)--(15.5,3));
label("15 ft",(7.5,0),S);
label("3 ft",(15,1.5),W);
label("5 ft",(17,1.5),SE);
[/asy]

For how many positive integral values of $a$ is it true that $x = 2$ is the only positive integer solution of the system of inequalities $$
\begin{cases}
2x>3x-3\\
3x-a>-6
\end{cases}
$$

An 8-foot by 10-foot floor is tiled with square tiles of size 1 foot by 1 foot. Each tile has a pattern consisting of four white quarter circles of radius 1/2 foot centered at each corner of the tile. The remaining portion of the tile is shaded. How many square feet of the floor are shaded?
[asy]
fill((5,5)--(5,-5)--(-5,-5)--(-5,5)--cycle,gray(0.7));
fill(Circle((-5,5),5),white);
fill(Circle((5,5),5),white);
fill(Circle((-5,-5),5),white);
fill(Circle((5,-5),5),white);
draw((-5,5)--(-5,-5)--(5,-5)--(5,5)--cycle);
[/asy]

In triangle $ABC,$ $E$ lies on $\overline{AC}$ such that $AE:EC = 2:1,$ and $F$ lies on $\overline{AB}$ such that $AF:FB = 1:4.$  Let $P$ be the intersection of $\overline{BE}$ and $\overline{CF}.$

[asy]
unitsize(0.8 cm);

pair A, B, C, D, E, F, P;

A = (1,4);
B = (0,0);
C = (6,0);
E = interp(A,C,2/3);
F = interp(A,B,1/5);
P = extension(B,E,C,F);

draw(A--B--C--cycle);
draw(B--E);
draw(C--F);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$E$", E, NE);
label("$F$", F, W);
label("$P$", P, S);
[/asy]

Then
\[\overrightarrow{P} = x \overrightarrow{A} + y \overrightarrow{B} + z \overrightarrow{C},\]where $x,$ $y,$ and $z$ are constants such that $x + y + z = 1.$  Enter the ordered triple $(x,y,z).$

In $\Delta ABC$, $\overline{DE} \parallel \overline{AB}, CD = 4$ cm, $DA = 10$ cm, and $CE = 6$ cm. What is the number of centimeters in the length of $\overline{CB}$?

