draw(C--B--D,linewidth(0.7));
label("$B$",B,N);
label("$A$",A,S);
label("$D$",D,S);
label("$C$",C,S);
label("$E$",E,S);
[/asy]

For all complex numbers $z$, let \[f(z) = \left\{
