draw(A--B--C--D--A);

a=(-0.25,0.1);
b=D+(A+a);
c=C+(A+a);

draw(A--a);

draw(D--b);

draw(C--c);

draw(a--b--c);

draw(A--b,1pt+dotted);

label("$B$",b,W);
label("$G$",A,NE);

dot(A);
dot(b);

